import { Morph, morph, show, TilingLayout } from "lively.morphic";
import { arr, obj, fun } from "lively.lang";
import { getAllPartResources, defaultPartsbinFolder, loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";
import { resource } from "lively.resources/index.js";
import { connect, disconnect } from "lively.bindings/index.js";
import { Rectangle, pt } from "lively.graphics/index.js";
import LoadingIndicator from "lively.morphic/components/loading-indicator.js";


export class Partsbin extends Morph {

  static get properties() {
    return {
      partsbinFolder: {
        get() {
          return this.getProperty("partsbinFolder") || defaultPartsbinFolder;
        },
        set(val) {
          if (this.partsbinFolder === val) return;
          this.setProperty("partsbinFolder", val);
        }
      },

      buttonBar: {
        readOnly: true, derived: true, after: ["submorphs"],
        get() { return this.getSubmorphNamed("button-bar"); }
      },

      partItemList: {
        readOnly: true, derived: true, after: ["submorphs"],
        get() { return this.getSubmorphNamed("partItemList"); }
      },

      previews: {
        after: ["partItemList"],
        set(previewMorphs) {
          this.setProperty("previews", previewMorphs);
          this.partItemList.submorphs = [
            ...previewMorphs, this.getSubmorphNamed('footer')
          ];
        }
      },
      categories: {
        get() { return this.getProperty('categories') || [] },
        set(categories) { 
          this.setProperty('categories',categories);
          this.filterCategories(categories)          
        },
        defaultValue: []
      }
    }
  }

  get isPartsBin() { return true }

  reset() {
    this.clipMode = "hidden";
    this.partItemList.layout = new TilingLayout({spacing: 10})
    this.partItemList.fill = null
    this.partItemList.clipMode = "auto";
    connect(this, 'partsbinFolder', this, 'update');

    this.getSubmorphNamed("reload-button");

    connect(this.getSubmorphNamed("search-input"), 'inputChanged', this, 'filterItemsDebounced', {
      converter: function() { return this.sourceObj.input; }
    });
  }

  beforePublish() {
    this.clear();
    this.owner.activate();
  }

  async onLoad(snapshot, rev) {
    let loadingIndicator = LoadingIndicator.open('Loading Partsbin...');
    await loadingIndicator.whenRendered();
    loadingIndicator.openInWorld();
    await this.update();
    loadingIndicator.remove();
  }

  clear() {
    this.previews = [];
  }

  async update() {
    // await this.update()

    this.clear();

    let {partsbinFolder} = this,
        partResorces = await getAllPartResources({partsbinFolder}),
        previewProto = await loadObjectFromPartsbinFolder("part-item-for-partsbin", {
          partsbinFolder
        });

    for (let partResource of partResorces) {
      let closeButton = morph({
        type: "button",
        ...obj.select(previewProto.submorphs[0], ["name", "extent", "styleSheets"]),
        position: pt(80,10), visible: false,
        label: [
          "",
          {
            _rev: 0,
            fontFamily: "",
            textStyleClasses: ["fa"]
          }
        ]
      }),
          preview = new previewProto.constructor({
            extent: pt(100, 100),
            submorphs: [closeButton]
          });
      connect(closeButton, 'fire', preview, 'interactivelyRemovePart');
      this.previews = [...this.previews, preview];
      this.showPart(partResource.url, preview);
    }
  }
  async showPart(partURL, previewMorph) {
    // let partURL = "http://localhost:9011/lively.morphic/parts/ChatWidget.json"
    // await this.showPart(partURL)

    if (!previewMorph) {
      previewMorph = this.previews.find(ea =>
        ea.partResource && ea.partResource.url === partURL);
    }

    if (!previewMorph) {
      let {partsbinFolder} = this;
      previewMorph = await loadObjectFromPartsbinFolder("part-item-for-partsbin", {partsbinFolder});
      this.previews = [...this.previews, previewMorph];
    }

    return previewMorph.showPart(resource(partURL));
  }

  async onPartPublished({url, partName}) {
    await this.showPart(url);
    this.setStatusMessage("updating part " + url);
  }

  filterItemsDebounced(queryString) {
    fun.debounceNamed(this.id + "-filterItemsDebounced", 100,
      queryString => this.filterItems(queryString))(queryString);
  }

  filterItems(queryString = "") {
    queryString = queryString.toLowerCase();
    this.partItemList.layout.disable();
    let [matchingParts, fadingParts] = queryString ?
      arr.partition(this.previews, ea => ea.partName.toLowerCase().includes(queryString)) :
      [this.previews, []];
    this.partRefresh(matchingParts,fadingParts);   
  }
  filterCategories(categories){
    if (!this.previews) { 
      return
    }
    var self = this;
    var shapeList = ['Shapes help', 'Canvas','image','ellipse','label','rectangle','star','text'],
        ioList = ['IO help' , 'SketchingPalette','SoundCapture','CameraSnap','Speaker'],
        widgetList = ['Widgets help' , 'button','dropdown list','filterable list','list','input-line','progress bar','slider','search-input','tab-buttons','tree'],
        appList = ['Application Help', 'Letter Game','nlp-tester','CategoryVisualization']
    var partList = []
    switch (categories){
        case 'shapes': 
          partList = shapeList;
          break;        
        case 'io' : 
          partList = ioList;
          break;        
        case 'widgets' : 
          partList = widgetList;
          break;        
        case 'apps' : 
          partList = appList;
          break;        
        case 'all' :          
        default : 
          categories = false
          break
    }

    let [matchingParts, fadingParts] = categories ?        
        arr.partition(this.previews, (ea) => (partList.indexOf(ea.partName) > -1)  )
    : [this.previews, []];
    this.partRefresh(matchingParts,fadingParts);
  }
  partRefresh(matchingParts,fadingParts){
    matchingParts.forEach(p => {
       let reappearing = !p.owner;
       this.partItemList.addMorph(p, this.getSubmorphNamed('footer'));
       if (reappearing) { 
         p.animate({opacity: 1, duration: 300});
       }
    });
    fadingParts.forEach(p => { 
        p.owner && (async () => {
           let pos = p.globalPosition;
           this.addMorph(p);
           p.globalPosition = pos;
           await p.animate({opacity: 0, duration: 300});
           p.remove();
        })();
    })
    this.partItemList.layout.enable({duration: 300});
  }
}

