import { List } from "lively.morphic/components/list.js";

export default class AList1 extends List {
  onItemMorphClicked(evt, itemMorph){
    super.onItemMorphClicked(evt, itemMorph)    
    var pb = this.owner.owner.owner.getSubmorphNamed("PartsBin")
    var categories = this.selections.map(function(ea){
      return ea.value ? ea.value : ea
    })
    if (categories.length == 1) { categories = categories[0] }
    pb.setProperty('categories', categories)
    pb.filterCategories(categories)
  }
}
